import React from 'react';
import Task from './Task';

function TaskList({ tasks, deleteTask }) {
  return (
    <div>
      {tasks.map((task) => (
        <div key={task.id}>
          <Task task={task} deleteTask={deleteTask} />
        </div>
      ))}
    </div>
  );
}

export default TaskList;
